import { Box, Text, Center, Icon, VStack } from "@chakra-ui/react";
import { Link } from "react-router-dom";
import styles from "./featureIcons.module.css";

export default function FeatureIcon({ icon, link, heading, subheading }) {
  return (
    <VStack className={styles.container}>
      <Center>
        <Box className={styles.box}>
          <Link to={link}>
            <Icon className={styles.icon} as={icon} />
          </Link>
        </Box>
      </Center>
      <Box className={styles.textBox}>
        <Text>{heading}</Text>
        <Text fontSize="1rem" fontWeight="semibold">
          {subheading}
        </Text>
      </Box>
    </VStack>
  );
}
